          name: file.name,
          size: file.size,
          type: file.type,
          lastModified: file.lastModified,
        }));
        // You can now use the 'files' array to do something with the selected files
      }
    return (

        <div className="Chess">


            <div >

                <h1>Chess</h1>
                <div>
        <img src={chessimg} alt="BigCo Ind"/>
